import { Icon, Heading, Button } from "../../components";
import { UserOverview_Styles, PlayerOverview_Styles } from "./Dash_Styles";
import { Team_List } from "./Team";

export const Overview = ({
  name = "",
  email = "",
  homePhone = "",
  players = [],
}) => {
  return (
    <UserOverview_Styles>
      <Heading type="Small">{name}</Heading>
      {players.map(({ sport, name: n }) => (
        <>
          <Heading type="Small">{n}</Heading>
          <Icon type={sport} />
        </>
      ))}

      <span>
        <Icon type="phone" />
        <Heading type="Small">{homePhone}</Heading>
      </span>
      <span>
        <Icon type="mail" />
        <Heading type="Small">{email}</Heading>
      </span>
      <Icon type="message" messages={1} />
    </UserOverview_Styles>
  );
};

export const Player_Card = ({
  name = "Julia",
  dob = "7-9yr",
  teams = [],
  size = "S",
}) => {
  return (
    <div className="Player_Entry">
      <Heading type="Sub">{name}</Heading>
      <Heading type="Small">{dob}</Heading>
      <Icon size={size} type="shirt" />
      <Team_List />
    </div>
  );
};

export const AddButton = () => (
  <Button type="Small">
    <Icon type="plus" />
    Add Player
  </Button>
);
